import {Link}  from 'react-router-dom';
import { useState, useEffect } from 'react';
import {GoogleLogout} from 'react-google-login';
import { gapi } from 'gapi-script';

const clientId = "925306536966-8krnsg2kdor08se5s6d47vla1pec5f2f.apps.googleusercontent.com";
const Reviewheader = () =>{




  const logout = () =>{
    window.localStorage.clear();
    window.location.href="http://localhost:3000/#/"; // it will go to dashboard
    window.location.reload(); // it will reload the app. js(window) file
  }
  
    let[isHidden, setIsHidden] = useState(true);
    return(
        <nav className="navbar bg-body-tertiary  p-4 h1" >
          <div className="container-fluid">
         <span className="navbar-brand mb-0 h1">Feedback Portal</span>
           {/* hide the button onclick */}
           <div className="btn btn-group">
          <Link to="/Addfeedback" className="menu"> {isHidden && <button className="btn btn-danger" type="submit" onClick={() => setIsHidden(false)}>Add Feedback</button>} </Link>
          <button className="btn btn-warning" onClick={logout}> Welcome - {localStorage.getItem("fullname") } Logout <i className="fa fa-power-off"></i>  </button>
          </div>
      </div>
       </nav>
    
    )
}
export default Reviewheader;
